import React from "react";

export default function Filter({ children }: { children: React.ReactNode }) {
	return (
		<div id="Filter" title="Filter" className="filter-container">
			<label htmlFor="filter" className="btn btnFilter">
				Filter
			</label>
			<input type="checkbox" name="filter" id="filter" />
			<div className="filter-modal">{children}</div>
		</div>
	);
}
